DROP TABLE IF EXISTS  Celeb ;

CREATE TABLE  Celeb (
   CELEB_ID	 int 		NOT NULL AUTO_INCREMENT,
   FName  	 varchar(20)  	NOT NULL,
   LName  	 varchar(20) 	NOT NULL,
   Picture	 MEDIUMBLOB,
   Twitter	 varchar(40),
  PRIMARY KEY  ( CELEB_ID )
);

